import Link from "next/link";
import "../public/css/styles.css";
const myFunction = () => {
  x.classList.toggle("change");
  if (
    navigation.querySelector("nav").style.display == "none" ||
    navigation.querySelector("nav").style.display == ""
  )
    navigation.querySelector("nav").style.display = "flex";
  else navigation.querySelector("nav").style.display = "none";
};

const Navbar = () => (
  <div className="navigation">
    <div className="nav-content">
      <h1 className="myName">
        <span>Pranesh Shrestha</span>
      </h1>
      <nav>
        <Link href="/">
          <a> Home </a>
        </Link>
        <Link href="/skills">
          <a> Skills </a>
        </Link>
        <Link href="/projects">
          <a> Projects </a>
        </Link>
        <Link href="contact">
          <a> Contact </a>
        </Link>
      </nav>
      <div className="ham" onClick={myFunction()}>
        <div className="bar1"></div>
        <div className="bar2"></div>
        <div className="bar3"></div>
      </div>
    </div>
  </div>
);

export default Navbar;
